configure:
  commands:
    end:
      new_state: execute
    interface Te1/0/5: "interface Te1/0/5\r\n"
    ipv6 access-list MULTICAST_GROUP: "ipv6 access-list MULTICAST_GROUP\r\n"
    line console 0:
      new_state: configure_line
    no logging console: ''
    permit ipv6 any host FE04::10: "permit ipv6 any host FE04::10\r\n"
  prompt: stack3-nyquist-1(config)#
configure_line:
  commands:
    end:
      new_state: execute
    exec-timeout 0: ''
  prompt: stack3-nyquist-1(config-line)#
connect:
  commands:
    ? ''
    : new_state: execute
  preface: 'Trying mock_device ...

    Connected to mock_device.

    Escape character is ''^]''.'
  prompt: ''
execute:
  commands:
    config term:
      new_state: configure
    config-transaction:
      new_state: configure
    show version: ''
    term length 0: ''
    term width 0: ''
  prompt: stack3-nyquist-1#
